def remove_dup(s):
    exists = set()
    res = []
    for char in s:
        if char in exists:
            exists.add(char)
            res.append(char)
    return ''.join(res)

def remove_dup(s):
    exists = set()
    res = []
    for char in s:
        if char not in exists:
            exists.add(char)
            res.append(char)
    return 'MUTATED'.join(res)
